window.bookSummaryJSON = "<p><i>Move over, Buffy! Tinker not only kicks supernatural butt - shes a techie genius, too!</i> </p> <p>Inventor, girl genius Tinker lives in a near-future Pittsburgh which now exists mostly in the land of the elves. She runs her salvage business, pays her taxes, and tries to keep the local ambient level of magic down with gadgets of her own design. When a pack of wargs chase an Elven noble into her scrap yard, life as she knows it takes a serious detour. Tinker finds herself taking on the Elven court, the NSA, the Elven Interdimensional Agency, technology smugglers and a college-minded Xenobiologist as she tries to stay focused on whats really important her first date. Armed with an intelligence the size of a planet, steel toed boots, and a junk yard dog attitude, Tinker is ready to kick butt to get her first kiss.</p>"; 
